import React, { Component } from "react";
import { Icon } from "antd";

import "./index.css";

export default class Footer extends Component {
  render() {
    return (
      <div id="footer">
        Footer
        <Icon type="github" />
        <Icon type="linkedin" theme="filled" />
      </div>
    );
  }
}
